var loginFree=!0;function login(){if(loginFree){$("#login-card").loading(),loginFree=!1;var o=$("#emaillog").val(),n=$("#passlog").val(),a=$("#g-recaptcha-response").val();post("session-control","login",{email:o,pass:n,recaptcha:a},function(o){o?toast(o,"warning",3e3):(toast("Logando...",2e3),setTimeout(function(){window.location.href=HOME+"dashboard"},1500)),loginFree=!0})}}$("#emaillog, #passlog").on("keyup",function(o){13===o.which&&login()});